import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class FavoriteItem extends Component {
    render() {
        let { item } = this.props
        item = item[0]
        return (
            <Link to={`/{item.name}`} className='items-card' >
                <img src={`/${item.img}`} />
            </Link>
        )
    }


}

export { FavoriteItem }
